import React from 'react';

class EventPhoto extends React.Component {
    render() {
        return (
            <div className="tile is-child is-img-tile ">
            <figure className={"image is-" + this.props.img_shape}>
              <img className="event-photo" src={this.props.img} />
            </figure>
          </div>
        );
}
}



class EventSummary extends React.Component {
  render() {
    return (
<div className="event-summary">
      <a className="fancy-title clean-link" id="event-summary"
        href="#event-summary">Event Summary</a>

      <div className="tile is-ancestor">
        <div className="tile is-3 is-vertical is-parent">
          <div className="tile is-child">
            {this.props.description}
          </div>

        </div>
        <div className="tile is-parent">
          <div className="tile is-child is-photos-tile">
            <div className="tile is-parent">
              <div className="tile is-4 is-vertical is-parent">
                <EventPhoto img_shape="square" img="imgs/hackathon/vert.jpg" />


                <div className="tile is-child is-img-tile ">
                  <figure className="image is-4x5">
                    <img className="event-photo" src="imgs/hackathon/vert.jpg" />
                  </figure>
                </div>
              </div>
              <div className="tile is-parent is-vertical">
                <div className="tile is-child is-img-tile">
                  <figure className="image is-4by3">
                    <img className="event-photo" src="imgs/hackathon/big.jpg" />
                  </figure>
                </div>

                <div className="tile is-child is-img-tile">
                  <figure className="image is-3by1">
                    <img className="event-photo" src="imgs/hackathon/banner.jpg" />
                  </figure>
                </div>
              </div>

            </div>
          </div>
        </div>
      </div>
    </div>
      );
    }
}

export default EventSummary;
